import { Component, EventEmitter, Input, Output } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Color, Icon } from '../api';
import { ButtonComponent, ButtonEvent } from '../button';
import { TooltipDirective } from '../tooltip/tooltip.directive';

@Component({
  selector: 'tb-alert',
  standalone: true,
  imports: [CommonModule, ButtonComponent, TooltipDirective],
  template: ` <div class=" {{ color }}" role="alert">
    <span class="icon">{{ icon }}</span>
    <span>{{ message }}</span>
    <div class="grow-1"></div>
    <tb-button
      buttonType="icon-button"
      buttonSize="small"
      buttonStyleType="inbox"
      [color]="color"
      icon="close"
    ></tb-button>
  </div>`,
})
export class AlertComponent {
  /** Close event */
  @Output() closeEvent = new EventEmitter<ButtonEvent>();
  /** Alert color */
  @Input() color: Color = 'primary';

  /** Alert icon */
  @Input() icon: Icon = 'info';

  /** Alert message */
  @Input() message = 'Message';

  @Input() closable = true;

  close() {
    this.closeEvent.emit({
      type: 'click',
      payload: {
        label: 'Closed alert',
      },
    });
  }
}

import {
  AfterViewInit,
  Component,
  ElementRef,
  EventEmitter,
  Input,
  Output,
  ViewChild,
} from '@angular/core';
import { buttonStyle, ButtonType, Color, Icon, Position } from '../api';
import { CommonModule } from '@angular/common';
import { TooltipDirective } from '../tooltip/tooltip.directive';

export type ButtonEvent = {
  id?: string;
  type: 'click';
  payload: {
    uuid?: string;
    label?: string;
    message?: string;
  };
};

@Component({
  selector: 'tb-button',
  standalone: true,
  imports: [CommonModule, TooltipDirective],
  template: `
    <button
      #button
      (click)="emitClickEvent()"
      [tbTooltip]="tooltip"
      [tbTooltipPosition]="tooltipPosition"
    >
      <span class="button-icon icon" *ngIf="type !== 'button'">{{ icon }}</span>
      <span class="button-label" *ngIf="type !== 'icon-button'">
        {{ label }}
      </span>
    </button>
  `,
})
export class ButtonComponent implements AfterViewInit {
  /** @ignore */
  @ViewChild('button') button?: ElementRef<HTMLButtonElement>;
  @Input() color: Color = 'primary';
  @Input() icon: Icon = 'info';
  @Input() label = 'Button';
  @Input() size: 'small' | 'regular' | 'big' = 'regular';
  @Input() tooltip?: string;
  @Input() tooltipPosition?: Position;
  @Input() type: ButtonType = 'button';
  @Input() uuid = 'Id not set!';
  @Input() variant: buttonStyle = 'basic';

  /** Click Event  */
  @Output() readonly clickEvent = new EventEmitter<ButtonEvent>();

  /** @ignore */
  ngAfterViewInit(): void {
    this.addClasses(this.size, this.variant, this.type, this.color);
  }

  /** @ignore */
  private addClasses(...className: string[]) {
    this.button?.nativeElement.classList.add(...className);
  }

  emitClickEvent() {
    this.clickEvent.emit({
      type: 'click',
      payload: {
        label: this.label,
        uuid: this.uuid,
      },
    });
  }
}

